import React from "react";
import styles from "../styles/styles";
import products from "../products.json";
import Basket from "./basket";

export default function Basketlist() {
    return (
      <>
        <div className="d-flex flex-column" style={{paddingBottom:"20%"}}>
          {products.map((product, index) => (
            <Basket basket={product} index={index} />
          ))}

          <div className="d-flex flex-end">
            <div
              className="p-2 justify-center align-items-center fs-2 fw-3 "
              style={{
                position: "fixed",
                bottom: "0",
                backgroundColor: "white",
                width: "100%",
                borderTop: "1px solid gray",
              }}
            >
              <p style={{marginLeft:"5%",alignItems:"center",justifyContent:"center"}}>Toplam 300 TL</p>
            </div>
          </div>
        </div>
      </>
    );
}
